Page({
    data: {
        bgSrc: "",
        con: "",
        money: "",
        tips: "",
        moneydi: "",
        name: "",
        account_on: ""
    },
    onLoad: function(S) {
        this.setData({
            money: S.money,
            tips: wx.$cache.get("can").withdrawal_content,
            moneydi: wx.$cache.get("can").withdrawal_low
        }), this.tu();
    },
    godetail: function() {
        wx.navigateTo({
            url: "/pages/withdrawalDetails/withdrawalDetails"
        });
    },
    quan: function() {
        this.setData({
            con: this.data.money
        });
    },
    btn: function() {
        if (this.data.con > Number(this.data.money)) wx.showToast({
            title: "您没有这么多钱",
            icon: "none"
        }); else {
            var S = {
                change_num: this.data.con,
                account_type: 2,
                account_on: this.data.account_on || "",
                account_realname: this.data.name || ""
            };
            wx.$http.get(wx.$get.apply_amount, S).then(function(S) {
                console.log("提现"), wx.showToast({
                    title: "申请成功"
                }), setTimeout(function() {
                    wx.navigateBack({
                        delta: 1
                    });
                }, 1500);
            });
        }
    },
    onReady: function() {},
    tu: function() {
        this.setData({
            bgSrc: "data:image/png;base64,"
        });
    },
    onShow: function() {},
    onHide: function() {},
    onUnload: function() {},
    onPullDownRefresh: function() {},
    onReachBottom: function() {},
    onShareAppMessage: function() {
        return {
            title: wx.$cache.get("fx").title,
            imageUrl: wx.$cache.get("fx").img,
            path: "/pages/index/index?pid=".concat(wx.$cache.get("member_id"))
        };
    }
});